	local shapes = util.from_json(shapestring)
	local bnbs = util.from_json(airbnb)
	
	self.objects = {}
	self.points = {}
	
	--create stadtteil boundaries
	local teiltype = "hot"
	self.datastructure = {}
	for i,feature in pairs(shapes.features) do
		local newObj = {}
		newObj.name = feature.properties.name
		newObj.points = {}
		newObj.hits = 0
		newObj.teiltype = teiltype
		newObj.isPinned = false
		
		local isHighlighted = false
		for i,highlight in pairs(highlights) do
			if highlight == newObj.name then
				isHighlighted = true
			end
		end
		
		if isHighlighted then
			newObj.color = '#ff0000'
		else
			newObj.color = '#F5D5C0'
		end	
		
		table.insert(self.objects,newObj)
		
		--ping pong the teiltype
		if teiltype == "hot" then teiltype = "cold" else teiltype = "hot" end
		
		local poly = {}
		--read point data and create polygons
		for j,point in pairs(feature.geometry.coordinates[1][1]) do
			table.insert(newObj.points,convert(point[1],point[2]))
		end
		
	end

	--draw points to search
	for i,point in pairs(locations) do
		table.insert(self.points,convert(point[1],point[2]))
	end
	
	for i,point in pairs(bnbs.bnbs) do
		local radius =1.6^tonumber(point['counted-times'])
		table.insert(self.points,convert(point['data-lng'],point['data-lat'],radius))
	end
	
	for i, poly in pairs(self.objects) do
		local isPinned = false
		for j, point in pairs(self.points) do
			if pcontains(point.x,point.y,poly.points) then
				isPinned = true
				poly.hits = poly.hits + 1
			end
		end
		if isPinned then poly.color = '#6A608B' end
	end
	
	table.sort(self.objects,function(a,b)	return a.hits > b.hits end)
	local high = self.objects[1].hits
	local low = self.objects[#self.objects].hits
	
	for i,object in pairs(self.objects) do
		local percentOfMax = (object.hits-low)/(high-low)
		local color = rgbToHex({255-(255*percentOfMax),255-(255*percentOfMax),255})
		object.color = color
	end

	return { render = "index" }
end)

